{
    return(
    <div id="nav">

   <div></div>   
<Link to="/" >Home</Link>
<Link to="/about" class="navbar">About</Link>
<Link to="/contact" class="navbar">Contact</Link>
<Home></Home>
    </div>
    );
}
export default Navigation;
